import React, { Component } from 'react';
import './App.css';

class Live extends Component {
	render() {
		return (
			<div className="bx">
				<header>
					<h1>{this.props.title}</h1>
					<p className="countdown">60</p>
					<button className="btn_reload">
						<span className="blind">Refresh</span>
					</button>
				</header>
			</div>
		);
	}
}

export default Live;
